import React from "react";
import ReactDOM from "react-dom/client";

function APP() {
  return (
    <div>
      <h1>Welcome to the Pizza Menu</h1>
    </div>
  );
}

const root = ReactDOM.createRoot(document.getElementById("root"));
root.render(
  <React.StrictMode>
    <APP />
  </React.StrictMode>
);
